x[7] = 7;
x[8] = 8;
x[9] = 9;
```
Why it's useful: Reduces the overhead of the loop control statements, making the code faster.

**4. Register Allocation**

Register allocation is a technique where the compiler assigns variables to registers to reduce the number of memory accesses.

Example:
