function pack(entities) {
  const totalBits = entities.length * 7;
  const totalBytes = Math.ceil(totalBits / 8);
  const arrayBuffer = new ArrayBuffer(totalBytes);
  const dataView = new DataView(arrayBuffer);

  let offset = 0;
  for (const entity of entities) {
    const id = entity.id;
    const size = entity.size;
    const idBits = id << 3;
    const sizeBits = size & 0x7;
    const byte = idBits | sizeBits;
    dataView.setUint8(offset, byte);
    offset++;
  }

  return arrayBuffer;
}

function unpack(arrayBuffer) {
  const dataView = new DataView(arrayBuffer);
  const totalBytes = arrayBuffer.byteLength;
  const totalEntities = Math.floor(totalBytes * 8 / 7);

  const entities = [];
  let offset = 0;
  for (let i = 0; i < totalEntities; i++) {
    const byte = dataView.getUint8(offset);
    const id = byte >> 3;
    const size = byte & 0x7;
    entities.push({ id, size });
    offset++;
  }

  return entities;
}
